import React, { Component } from 'react'
import axios from 'axios'
import NavbarOther from '../../components/Navbar/NavbarOther'
import { connect } from 'react-redux'
import { signedIn, setViewer, setOwner } from '../../actions'
import Footer from '../../components/Footer'
// import Drawer from '../../components/Drawer'


class ProfileView extends Component {

    componentDidMount() {
        axios.get('/users').then(res => {
            signedIn(res.data)
            setViewer(res.data)
        })
    }

    render({ match }) {
        // match.params.id is the visitor
        // objective is to compare the visitor with the owner
        setOwner(match.params.id)
        return (
            <div>
                <NavbarOther />
                <Footer />
            </div>
        )
    }
}

const mapDispatchToProps = dispatch => {
    return {
        signedIn: id => dispatch(signedIn(id)),
        setOwner: id => dispatch(setOwner(id)),
        setViewer: id => dispatch(setViewer(id))
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(ProfileView)
